DROP TABLE IF EXISTS hebrew_morpho;
CREATE TABLE hebrew_morpho (
                    id INT (10) not null AUTO_INCREMENT PRIMARY KEY,
                    lemma VARCHAR (200) BINARY NOT NULL,
                    pos ENUM ('n','v','a','s','r') NOT NULL,
                    irregular_forms VARCHAR (200),
                    pronunciation VARCHAR (200), undotted VARCHAR(200) BINARY, dotted_without_dots VARCHAR (200) NOT NULL, variants TEXT, translit_dotted VARCHAR (200), translit_undotted VARCHAR (200),
                    miscellanea TEXT, 
                    INDEX lemma (lemma),
                    INDEX pos (pos),INDEX idx_dwd (dotted_without_dots),
                    INDEX pronunciation (pronunciation));

